      console.log('typeof this.dayArray', typeof this.dayArray)
    },
    drawDrainChart (id) {
      let data = JSON.parse(this.res)
      data = data.weather_hourly_1h[0].data
      // console.log('data', data[0].pre)
      var raindata = []
      var datedata = []
      for (let index = 0; index < 24; index++) {
        datedata.push(index)
        raindata.push(data[index].pre)
      }

      console.log(raindata)
      // 以上是数据处理
      this.myChart = echarts.init(document.getElementById(id))
      this.myChart.setOption({
        xAxis: {
          type: 'category',
          data: datedata
        },
        yAxis: {
          type: 'value'
        },
        series: [
          {
            data: raindata,
            type: 'bar',
            showBackground: true,
            backgroundStyle: {
              color: 'rgba(180, 180, 180, 0.2)'
            }
          }
        ]
      })
    },
    async rainSearch () {
      const res = await postSearch(this.form)
      console.log(res)
    }
  },
  created () {},
  mounted () {
    this.drawDrainChart('rainEchart')
    this.getDateArray()
  }
}
